import React from "react";
import MainHeader from "./mainHeader";
import Cards from "./cards";

interface MainProps {
  IDs: number[];
}

function Main(props: MainProps) {
  return (
    <div className="main">
      <MainHeader />
      <Cards IDs={props.IDs} />
    </div>
  );
}

export default Main;
